import React from 'react';

const LoginPage = () => {
  return (
    <div>
      <h1>Login Page</h1>
      <p>Please login with your Google account.</p>
      <a href="http://localhost:5000/auth/google">Login with Google</a>
    </div>
  );
};

export default LoginPage;
